    <style>

            padding: 20px;

        .header-container {
            display: flex;
            align-items: center;
            justify-content: center;
            margin-bottom: 20px;
            font-size: 16px;
        }
        .header-container select {
            margin-left: 10px;
        }
        .dashboard-container {
            max-width: 1200px;
            margin: 0 auto;
            padding: 0 10px;
        }
        .grid-container {
            display: grid;
            gap: 20px;
            grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
        }
        .chart-container {
            background-color: #fff;
            padding: 20px;
            border-radius: 8px;
            box-shadow: 0 2px 5px rgba(0,0,0,0.1);
            width: 100%;
        }

    <script>
        function changeDashboard() {
            var sel = document.getElementById("userSelect");
            var value = sel.value;
            var dashboards = document.getElementsByClassName("dashboard");
            for (var i = 0; i < dashboards.length; i++) {
                dashboards[i].style.display = "none";
            }
            document.getElementById("dashboard_" + value).style.display = "block";
        }
        window.onload = function() {
            document.getElementById("userSelect").value = "all";
            changeDashboard();
        };
    </script>
</body>
</html>
